  const [visible, setVisible] = useState(show);
  const timer = useRef<any>(null);

  const clas = classNames({
    'cat-show': show,
    'cat-hide': !show,
  });

  function hide() {
    timer.current = setTimeout(() => setVisible(show), duration);
  }

